import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faAngleDoubleUp } from "@fortawesome/free-solid-svg-icons";

const Posts = ({ posts, filtered, handleDelete }) => {
  return (
    <div id="entryWrapper">
      <div id="dateOrder">
        <FontAwesomeIcon icon={faAngleDoubleUp} />
        <p>DATE</p>
      </div>
      {filtered.map((post) => {
        return (
          <div class="entry" key={post.id}>
            <p class="entryDate">{post.date}</p>
            <p class="entryContent">{post.content}</p>
            <button name={post.content} id={post.id} onClick={handleDelete}>
              delete
            </button>
          </div>
        );
      })}
    </div>
  );
};

export default Posts;
